export default (function(a,b,c,d,e){return {data:{ZVEI8DCyAO:{data:{id:141,attributes:{imdbId:"tt0384806",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMzc1Njc2NDc3NV5BMl5BanBnXkFtZTYwODYyNzI3._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.0\u002F10"},{Source:"Rotten Tomatoes",Value:"23%"},{Source:"Metacritic",Value:"33\u002F100"}],item_lang:{data:{id:804,attributes:{title:c,plot:"In December 1975, George and Kathy Lutz along with their three children move into an elegant Long Island house. What they don't know is that the house was the site of a horrific mass murder a year before. They decide to keep the house and attempt to keep the horror in the past, but are now haunted by a murderous presence. This is until, George starts to behave weirdly and their daughter, Chelsea starts to see people. What follows is 28 days of sheer, unbridled terror for the family with demonic visions of the dead. Based on the true story of George and Kathy Lutz, The Amityville Horror remains one of the most horrifying haunted house stories ever told - because it actually happened.",slug:"the-amityville-horror"}}},books:{data:[{id:2314,attributes:{title:c,description:"“A fascinating and frightening book” (Los Angeles Times)—the bestselling true story about a house possessed by evil spirits, haunted by psychic phenomena almost too terrible to describe. In December 1975, the Lutz family moved into their new home on suburban Long Island. George and Kathleen Lutz knew that, one year earlier, Ronald DeFeo had murdered his parents, brothers, and sisters in the house, but the property—complete with boathouse and swimming pool—and the price had been too good to pass up. Twenty-eight days later, the entire Lutz family fled in terror. This is the spellbinding, shocking true story that gripped the nation about an American dream that turned into a nightmare beyond imagining—“this book will scare the hell out of you” (Kansas City Star).",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Vly8DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2019-12-03",publisher:"Gallery Books",subtitle:a}},{id:2315,attributes:{title:"Amityville horror",description:a,thumbnail:a,authors:[b],firstBook:d,published:"2019-01-01",publisher:a,subtitle:a}},{id:2316,attributes:{title:c,description:"In Dec. 1975, the Lutz family moved into their dream home, the same house where Ronald DeFeo had murdered his parents, brothers and sisters just one year earlier. A psychic phenomena followed and created the most terrifying experience and force them to leave.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ADsA_MxPewUC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:e,publisher:a,subtitle:a}},{id:2317,attributes:{title:c,description:a,thumbnail:a,authors:[b],firstBook:d,published:e,publisher:a,subtitle:"28 Days of Terror in a House Possessed by Evil Spirits"}},{id:2318,attributes:{title:"Six Sixty-six",description:"An innocent-looking but evil-filled house mysteriously appears at different times in different cities, each time waiting for the unwitting victim to rent it and then unleashing the terrifying force of the devil",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AcpPEg3aWNAC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1981-01-01",publisher:"Simon & Schuster",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940911808}}("","Jay Anson","The Amityville Horror",null,"1978-01-01"))